class Solution:

    def calculateMinimumHP(self, dungeon: List[List[int]]) ->int:
        m = len(dungeon)
        n = len(dungeon[0])
        dp = [([0] * n) for _ in range(m)]
        dp[0][0] = max(1, 1 - dungeon[0][0])
        for i in range(1, m):
            dp[i][0] = max(1, dp[i - 1][0] - dungeon[i][0])
        for j in range(1, n):
            dp[0][j] = max(1, dp[0][j - 1] - dungeon[0][j])
        for i in range(1, m):
            for j in range(1, n):
                dp[i][j] = max(1, min(dp[i - 1][j], dp[i][j - 1]) - dungeon[i
                    ][j])
        return dp[m - 1][n - 1]

