import math


def dist(p1, p2):
    return math.sqrt((p1[0] - p2[0]) ** 2 + (p1[1] - p2[1]) ** 2)


def check_collision(d1, d2, t):
    dx = d1[0] + d1[2] * t - (d2[0] + d2[2] * t)
    dy = d1[1] + d1[3] * t - (d2[1] + d2[3] * t)
    return dist([d1[0] + d1[2] * t, d1[1] + d1[3] * t], [d2[0] + d2[2
        ] * t, d2[1] + d2[3] * t]) < d1[4] + d2[4] + 1e-6


def merge(d1, d2, t):
    return [(d1[0] + d2[0] + (d1[2] - d2[2]) * t) / (d1[4] + d2[4]),
        (d1[1] + d2[1] + (d1[3] - d2[3]) * t) / (d1[4] + d2[4]), (d1[2] +
        d2[2]) / (d1[4] + d2[4]), (d1[3] + d2[3]) / (d1[4] + d2[4]), dist
        ([d1[0] + d1[2] * t, d1[1] + d1[3] * t], [d2[0] + d2[2] * t, d2[1
        ] + d2[3] * t)]


def simulate(drops, t_max=1000000.0):
    drops = sorted(drops, key=lambda x: x[0])
    while True:
        i = 0
        while i < len(drops) - 1:
            if check_collision(drops[i], drops[i + 1], t_max / len(drops)):
                drops = merge(drops[i], drops[i + 1], t_max / len(drops))
                drops = drops[:i] + [drops[i + 1]]
                i -= 1
            i += 1
        if len(drops) == 1:
            return drops[0], t_max
        if t_max <= 1000.0:
            return len(drops), t_max
        t_max *= 10.0
        drops = [(x + vx * t, y + vy * t, vx, vy, r) for x, y, vx, vy,
        r in drops]
    return len(drops), t_max


