        n = len(target)
        dp = [float('inf')] * (n + 1)
        dp[0] = 0

        for i in range(n + 1):
            for j in range(i, n + 1):
                if target[i:j] == 'A' * (j - i):
                    dp[j] = min(dp[j], dp[i] + (j - i))
        return dp[n]

    def compute_prefix_mutations(prefix):
        n = len(prefix)
        dp = [float('inf')] * (n + 1)
        dp[0] = 0

        for i in range(n + 1):
            for j in range(i, n + 1):
                if prefix[i:j] == 'A' * (j - i):
                    dp[j] = min(dp[j], dp[i] + (j - i))
        return dp[n]

    initial_state = s
    n = len(initial_state)

    def compute_full_replacement(k):
        initial_state = s
        n = len(initial_state)
        temp_state = initial_state[:k] + 'B' * k
        temp_state = temp_state + 'A' * (n - k)
        return compute_min_mutations(temp_state)

    def compute_partial_replacement(k):
        initial_state = s
        n = len(initial_state)
        temp_state = 'A' * k
        for i in range(k, n):
            temp_state = temp_state + 'A'
        return compute_min_mutations(temp_state)

    min_mutations = float('inf')
    for k in range(1, n + 1):
        min_mutations = min(min_mutations, compute_full_replacement(k)
