        v1_parts = version1.split('.')
        v2_parts = version2.split('.')
        max_len = max(len(v1_parts), len(v2_parts))
        i = 0
        while i < max_len:
            v1_val = int(v1_parts[i]) if i < len(v1_parts) else 0
            v2_val = int(v2_parts[i]) if i < len(v2_parts) else 0
            if v1_val > v2_val:
