def solve():
    w, h = map(int, input().split())
    image = []
    for _ in range(h):
        image.append(input())

    def rotate_clockwise(image):
        new_image = [['.' for _ in range(w)] for _ in range(h)]
        for i in range(h):
            for j in range(w):
                new_image[j][h - 1 - i] = image[i][j]
        return new_image

    def flip_horizontally(image):
        new_image = [['.' for _ in range(w)] for _ in range(h)]
        for i in range(h):
            for j in range(w):
                new_image[h - 1 - i][j] = image[i][j]
        return new_image

    def zoom_in(image):
        new_image = [['.' for _ in range(w * 2)] for _ in range(h * 2)]
        for i in range(h):
            for j in range(w):
                new_image[i][j] = image[i][j]
        return new_image

    def zoom_out(image):
        new_image = [['.' for _ in range(w // 2)] for _ in range(h // 2)]
        for i in range(h):
            for j in range(w):
                new_image[i][j // 2] = image[i][j]
        return new_image

    def compose_transformations(image):
        image = rotate_clockwise(image)
        image = flip_horizontally(image)
        image = zoom_in(image)
        image = zoom_out(image)
        return image

    final_image = compose_transformations(image)

    for row in final_image:
        print(''.join(row))


