                if grid[i][j] == 'R':
                    if j == m - 1:
                        changes += 1
                elif grid[i][j] == 'D':
                    if i == n - 1:
                        changes += 1
        return changes

    def find_min_changes(grid):
        if is_functional(grid):
            return 0
        min_changes = float('inf')
        for i in range(n):
            for j in range(m):
                temp_grid = [row[:] for row in grid]
                if temp_grid[i][j] == 'R':
                    temp_grid[i][j] = 'D'
                    min_changes = min(min_changes, count_changes(temp_grid))
                elif temp_grid[i][j] == 'D':
                    temp_grid[i][j] = 'R'
                    min_changes = min(min_changes, count_changes(temp_grid))
        return min_changes
    print(find_min_changes(grid))


