def solve():
    n, m, p = map(int, input().split())
    edges = []
    for _ in range(m):
        a, b, c = map(int, input().split())
        edges.append((a, b, c))

    graph = {i: [] for i in range(1, n + 1)}
    for a, b, c in edges:
        graph[a].append((b, c))

    dist = {i: float('inf') for i in range(1, n + 1)}
    dist[1] = 0

    max_score = -1

    def dijkstra(start_node):
        pq = [(0, start_node, {})]
        while pq:
            (cost, node, path) = heapq.heappop(pq)
            if cost > dist[node]:
                continue
            for neighbor, weight in graph[node]:
                new_path = path.copy()
                new_path[neighbor] = new_path.get(neighbor, 0) + weight
                if cost + 1 < dist[neighbor]:
                    dist[neighbor] = cost + 1
                    heapq.heappush(pq, (cost + 1, neighbor, new_path))
        return dist

    def calculate_max_score(end_node):
        nonlocal max_score
        dist = dijkstra(end_node)
        for start_node in range(1, end_node):
            scores = []
            for node in range(1, end_node + 1):
                score = 0
                for i in range(start_node, node + 1):
                    if graph[i]:
                        score += graph[i][0][1]
                score -= dist[node] - 1
                scores.append(score)
            max_score = max(max_score, max(scores))
        return max_score
