        for flight_index in range(len(best_flights)):
            best_arrival_time_at_B = max(best_arrival_time_at_B, best_flights[flight_index] + ta)

        valid_flights_to_C = []
        for flight_index in range(m):
            if best_arrival_time_at_B >= b[flight_index] + tb:
                heapq.heappush(valid_flights_to_C, (-b[flight_index] - tb, flight_index))

        best_arrival_time_at_C = 0
        while valid_flights_to_C:
            flight_index, _ = heapq.heappop(valid_flights_to_C)
            best_arrival_time_at_C = -1 * (b[flight_index] + tb)
            if not valid_flights_to_C:
                break

        if best_arrival_time_at_C > earliest_possible_arrival:
            earliest_possible_arrival = best_arrival_time_at_C

