def comb(n, k, md):
    if k < 0 or k > n:
        return 0
    if k == 0 or k == n:
        return 1
    if k > n // 2:
        k = n - k
    res = 1
    for i in range(k):
        res = res * (n - i) % md
        res = res * pow(i + 1, md - 2, md) % md
    return res


