        if r < n - 1 and board[r + 1][c] == 0 and exist[r + 1][c] == 0:
            neighbors.append('v ' + str(r + 1))
        return neighbors

    def solve_recursive(r, c, visited, moves):
        if (r, c) in visited:
            return moves
        exist[r][c] = 1
        neighbors = get_neighbors(r, c, exist)
        if not neighbors:
            return None
        for move in neighbors:
            new_moves = moves + [move]
            new_r, new_c = c, r
            if move.startswith('< '):
                new_c -= 1
            elif move.startswith('> '):
                new_c += 1
            elif move.startswith('^ '):
                new_r -= 1
            else:
                new_r += 1
            if 0 <= new_r < n and 0 <= new_c < m:
                if board[new_r][new_c] == 0:
                    result = solve_recursive(new_r, new_c, visited, new_moves)
                    if result:
                        return result
        return None
    moves = []
