def solve():
    n = int(input())
    edges = []
    for _ in range(n - 1):
        u, v = map(int, input().split())
        edges.append((u, v))
    adj = [[] for _ in range(n + 1)]
    for u, v in edges:
        adj[u].append(v)
        adj[v].append(u)
    dist = [float('inf')] * (n + 1)
    dist[1] = 0
    pq = [(0, 1)]
    while pq:
        d, u = heapq.heappop(pq)
        if d > dist[u]:
            continue
        for v in adj[u]:
            if dist[v] > d + 1:
                dist[v] = d + 1
                heapq.heappush(pq, (dist[v], v))
    count = 0
    for i in range(2, n + 1):
        if dist[i] > 2:
            count += 1
    ans = n - 1 - count
    print(ans)


