    print(''.join(ans))


def dfs(node, par, depth, adj):
    visited = [False] * len(adj)
    stack = deque([(node, par, depth)])
    while stack:
        curr, par, depth = stack.pop()
        if visited[curr]:
            continue
        visited[curr] = True
        for neighbor in adj[curr]:
            if neighbor != par:
                stack.append((neighbor, curr, depth + 1))
    for i in range(len(visited)):
        if not visited[i]:
            return False
    return True


solve()

